import React from 'react';
import { ReactComponent as SearchIcon } from '../../assets/search.svg';
// import { ReactComponent as Logo } from '../../assets/logo.svg';
// <Logo className='logo' />

import { HeaderContainer, LogoContainer, SearchBox, OptionsContainer, OptionLink } from './header.styles';

const Header = ( { currentUser, hidden } ) => (
    <HeaderContainer>
        <div className='logo-container' to="/">Logo</div>
        <div className='search-box'>
          <SearchIcon />
          <SearchBox />
        </div>
        <OptionsContainer>
          <h1>Sign In</h1>
          <h1>Profile</h1>
        </OptionsContainer>
    </HeaderContainer>
);

export default (Header);
